import React, { Fragment } from 'react';

const InputProject = () => {
    return(
    <Fragment>
        <h1>Add new Project</h1>
        <form>
            <p>Timer - Coming Soon</p>
            <p>Company</p>
            <input type="text"/>
            <p>Project Description</p>
            <input type="text"/>
            <p>Project Location</p>
            <input type="text"/>
            <button>Add</button>
        </form>
    </Fragment>
    )
}

export default InputProject;
